/** 
 * Runs serialization test on the return values of the static methods. <p>Test fails if default value cannot be determined for a constructor or factory method parameter, or if the constructor or factory method throws exception.
 * @return this tester
 */
public FactoryMethodReturnValueTester testSerializable() throws Exception {
  for (  Invokable<?,?> factory : getFactoriesToTest()) {
    Object instance=instantiate(factory);
    if (instance != null) {
      try {
        SerializableTester.reserialize(instance);
      }
 catch (      RuntimeException e) {
        AssertionError error=new AssertionFailedError("Serialization failed on return value of " + factory);
        error.initCause(e.getCause());
        throw error;
      }
    }
  }
  return this;
}
